import React, { Component } from 'react';   

class MatchSquads  extends Component {
   
    render() {
        const {match} =  this.props;
        console.log(match);

        return ( 
            <div> 
                 <h6> Match Squads </h6>
           </div> 
        );
    }
}
 
export default MatchSquads;
